import React, {useEffect, useState} from 'react';

const Main = () => {
    const [members1, setMembers1] = useState([])
    
    useEffect (() => {

        fetch('http://localhost:8080')
        .then(response => response.json())
        .then(data=>console.log(data))
        .catch(err => console.log(err))

    }, []);


    return(
        <div>
            {setMembers1()}
        </div>
    )
    
    
}
    
    
export default Main;
